const gulp = require('gulp');

const { cleanStatic } = require('./tasks/common');
const { assets } = require('./tasks/assets');
const { js, jsLint } = require('./tasks/js');
const { css, cssLint } = require('./tasks/css');
const { vendors } = require('./tasks/vendors');
const { watchCss } = require('./tasks/watch');
const { rainloop } = require('./tasks/rainloop');
const { owncloud } = require('./tasks/owncloud');

const clean = gulp.series(cleanStatic);

const lint = gulp.parallel(jsLint, cssLint);

const buildState1 = gulp.parallel(js, css, vendors);
const buildState2 = gulp.series(clean, assets, buildState1);

const build = gulp.parallel(lint, buildState2);

exports.css = css;
exports.lint = lint;
exports.build = build;
exports.default = build;

exports.watchCss = watchCss;

exports.rainloop = gulp.series(build, rainloop);
exports.owncloud = gulp.series(build, owncloud);
exports.all = gulp.series(exports.rainloop, exports.owncloud);

#!/bin/bash
#Build RainLoop Webmail Debian Package
PACKAGEVERSION="0";

#Build rainloop
gulp build;
cd build/dist/releases/webmail;
cd $(ls -t);	#Most recent build folder

#Working directory
mkdir rainloop-deb-build;
cd rainloop-deb-build;

#Prepare zip file
unzip ../rainloop-legacy-latest.zip;
find . -type d -exec chmod 755 {} \;
find . -type f -exec chmod 644 {} \;

#Set up package directory
VERSION=$(cat data/VERSION);
DIR="rainloop_$VERSION-$PACKAGEVERSION";
mkdir -m 0755 -p $DIR;
mkdir -m 0755 -p $DIR/usr;
mkdir -m 0755 -p $DIR/usr/share;
mkdir -m 0755 -p $DIR/usr/share/rainloop;
mkdir -m 0755 -p $DIR/var;
mkdir -m 0755 -p $DIR/var/lib;

#Move files into package directory
mv rainloop $DIR/usr/share/rainloop/rainloop;
mv index.php $DIR/usr/share/rainloop/index.php;
mv data $DIR/var/lib/rainloop;

#Update settings for Debian package
sed -i "s/\$sCustomDataPath = '';/\$sCustomDataPath = '\/var\/lib\/rainloop';/" $DIR/usr/share/rainloop/rainloop/v/$VERSION/include.php

#Set up Debian packaging tools
cd $DIR;
mkdir -m 0755 DEBIAN;

#Create Debian packging control file
cat >> DEBIAN/control <<-EOF
	Package: rainloop
	Version: $VERSION
	Section: web
	Priority: optional
	Architecture: all
	Depends: php5-fpm (>= 5.4), php5-curl, php5-json
	Maintainer: Rainloop <support@rainloop.net>
	Installed-Size: 20330
	Description: Rainloop Webmail
	 A modern PHP webmail client.
EOF

#Create Debian packaging post-install script
cat >> DEBIAN/postinst <<-EOF
	#!/bin/sh
	chown -R www-data:www-data /var/lib/rainloop
EOF
chmod +x DEBIAN/postinst;

#Build Debian package
cd ..;
fakeroot dpkg-deb -b $DIR;

#Clean up
mv $DIR.deb ..;
cd ..;
rm -rf rainloop-deb-build;

const path = require('path');
const webpack = require('webpack');
const CopyWebpackPlugin = require('copy-webpack-plugin');

const devPath = path.resolve(__dirname, 'dev');
const devPathJoin = path.join(__dirname, 'dev');
const externalPathJoin = path.join(__dirname, 'dev', 'External');
const loose = true;

const babelLoaderOptions = function() {
	return {
		ignore: [/\/core-js/],
		cacheDirectory: true,
		overrides: [
			{
				test: './node_modules/',
				sourceType: 'unambiguous'
			}
		],
		presets: [
			[
				'@babel/preset-env',
				{
					useBuiltIns: 'usage',
					corejs: { version: 3, proposals: true },
					loose: loose,
					modules: false
				}
			]
		],
		plugins: [
			[
				'@babel/plugin-transform-runtime',
				{
					corejs: 3,
					loose: loose,
					useESModules: true
				}
			],
			[
				'@babel/plugin-proposal-decorators',
				{
					legacy: true,
					loose: loose
				}
			],
			[
				'@babel/plugin-proposal-class-properties',
				{
					loose: loose
				}
			]
		]
	};
};

process.noDeprecation = true;
module.exports = function(publicPath, mode) {
	return {
		mode: mode || 'development',
		devtool: 'inline-source-map',
		entry: {
			'js/polyfills': path.join(devPathJoin, 'polyfills.js'),
			'js/boot': path.join(devPathJoin, 'boot.js'),
			'js/app': path.join(devPathJoin, 'app.js'),
			'js/admin': path.join(devPathJoin, 'admin.js')
		},
		output: {
			pathinfo: true,
			path: path.join(__dirname, 'rainloop', 'v', '0.0.0', 'static'),
			filename: '[name].js',
			publicPath: publicPath || 'rainloop/v/0.0.0/static/'
		},
		performance: {
			hints: false
		},
		optimization: {
			concatenateModules: false,
			minimize: false
		},
		plugins: [
			new webpack.DefinePlugin({
				'process.env.NODE_ENV': JSON.stringify('production'),
				'process.env': {
					NODE_ENV: JSON.stringify('production')
				}
			}),
			new webpack.DefinePlugin({}),
			new CopyWebpackPlugin([
				{ from: 'node_modules/openpgp/dist/openpgp.min.js', to: 'js/min/openpgp.min.js' },
				{ from: 'node_modules/openpgp/dist/openpgp.worker.min.js', to: 'js/min/openpgp.worker.min.js' }
			])
		],
		resolve: {
			modules: [devPath, 'node_modules'],
			extensions: ['.js'],
			alias: {
				'Opentip$': path.join(externalPathJoin, 'Opentip.js'),
				'ko$': path.join(externalPathJoin, 'ko.js')
			}
		},
		module: {
			rules: [
				{
					test: /\.js$/,
					loader: 'babel-loader',
					include: [devPath],
					options: babelLoaderOptions()
				},
				{
					test: /\.html$/,
					loader: 'raw-loader',
					include: [devPath]
				},
				{
					test: /\.css/,
					loaders: ['style-loader', 'css-loader'],
					include: [devPath]
				},
				{
					test: /\.json$/,
					loader: 'json-loader',
					include: [devPath]
				}
			]
		},
		externals: {
			'window': 'window',
			'progressJs': 'window.progressJs',
			'moment': 'window.moment',
			'ifvisible': 'window.ifvisible',
			'crossroads': 'window.crossroads',
			'hasher': 'window.hasher',
			'Jua': 'window.Jua',
			'Autolinker': 'window.Autolinker',
			'ssm': 'window.ssm',
			'key': 'window.key',
			'_': 'window._',
			'qr': 'window.qr',
			'$': 'window.jQuery'
		}
	};
};
